import React, { useEffect, useRef, useCallback, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import '../assets/css/animate.min.css';
import '../assets/css/aos.min.css';
import '../assets/fonts/font-awesome.min.css';
import '../assets/css/style-font.css';
import Collapse from 'bootstrap/js/dist/collapse';
import AOS from 'aos';
import FeetLogo from "../assets/img/feet dreams logo fav white.webp";
import FeetText from "../assets/img/geet dreams logo text white.webp";
import 'aos/dist/aos.css';


function Nav(paramDict) {
  const mainNavRef = useRef(null);
  const navbarCollapseRef = useRef(null);
  const [collapse, setCollapse] = useState(null);

  const handleClick = useCallback(() => {
    if (collapse) {
      collapse.hide();
    }
  }, [collapse]);

  useEffect(() => {
    AOS.init({
      duration: 1000, // Default duration for all animations
    });
  }, []);
  
  useEffect(() => {
    const mainNav = mainNavRef.current;
    const navbarCollapse = navbarCollapseRef.current;
    if (mainNav && navbarCollapse) {
      const collapseInstance = new Collapse(navbarCollapse, { toggle: false });
      setCollapse(collapseInstance);
    }
  }, []);

  useEffect(() => {
    const collapseNavbar = () => {
      const scrollTop = (window.pageYOffset !== undefined) ? window.pageYOffset : (document.documentElement || document.body.parentNode || document.body).scrollTop;
      const navLinks = mainNavRef.current.querySelectorAll('.nav-link');


      if (scrollTop > 100) {
        mainNavRef.current.classList.add("navbar-shrink");
        mainNavRef.current.style.backgroundColor = "black";
        navLinks.forEach(link => link.classList.add('nav-link-white'));

      } else {
        mainNavRef.current.classList.remove("navbar-shrink");
        mainNavRef.current.style.backgroundColor = "transparent";
        navLinks.forEach(link => link.classList.remove('nav-link-white'));
      }
    };

    collapseNavbar();
    document.addEventListener("scroll", collapseNavbar);

    return () => {
      document.removeEventListener("scroll", collapseNavbar);
    };
  }, []);

  return (
    <section id="page-top" data-bs-spy="scroll" data-bs-target="#mainNav" data-bs-offset="77">
      <nav className="navbar navbar-light navbar-expand-md fixed-top" id="mainNav" ref={mainNavRef}>
      <div className="container"><a className="navbar-brand d-grid" href="index.html" style={{width: "70px", paddingRight: "0px", marginRight: "0px", height: "70px"}}><img className="img-fluid d-block d-xxl-flex justify-content-xxl-start tada animated" src={FeetLogo} style={{background: "rgba(255,255,255,0)", margin: "-6px", padding: "0px", marginLeft: "0px", marginRight: "0px"}}/></a><img className="img-fluid d-none d-sm-inline d-md-none d-lg-none d-xl-inline d-xxl-inline flex-shrink-1" data-bss-disabled-mobile="true" data-aos="fade" data-aos-duration="500" src={FeetTExt} style={{overflow: "visible", transform: "perspective(0px) skew(0deg)"}}/><button data-bs-toggle="collapse" className="navbar-toggler navbar-toggler-right" data-bs-target="#navbarResponsive" type="button" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation" value="Menu"><i className="fa fa-bars"></i></button>
                <div className="collapse navbar-collapse" id="navbarResponsive" ref={navbarCollapseRef}>
                    <ul className="navbar-nav ms-auto">
                        <li className="nav-item nav-link"><a className="nav-link active" href="#about" onClick={handleClick}>Qu'est-ce que c'est ?</a></li>
                        <li className="nav-item nav-link"><a className="nav-link" href="#tarifs" onClick={handleClick}>Tarifs</a></li>
                        <li className="nav-item nav-link"><a className="nav-link" href="#contact" onClick={handleClick}>contact</a></li>
                        <li className="nav-item nav-link"><a className="nav-link" href="#videos" onClick={handleClick}>Videos</a></li>
                        <li className="nav-item nav-link"><a className="nav-link tada animated" href="/rendezvous" style={{backgroundColor: "#5c9688"}} onClick={handleClick}>PRENDRE RENDEZ-VOUS</a></li>
                    </ul>
                </div>
            </div>
      </nav>
    </section>
  )
}

export default Nav;
